INSERT INTO `services` (`id`, `name`, `description`, `icon`, `route`, `status_active`, `is_delete`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
	(1, 'Agile Development', 'Work with Scrum teams using agile methodologies to bring transparency and flexibility to product development. Toptal can help your company easily build a new Scrum team or bring additional talent to an existing one.', 'mdi mdi-powershell', NULL, 1, 0, 1, NULL, '2024-09-04 08:44:41', '2024-09-04 08:44:41'),
	(2, 'Tailored Web Development', 'Having an intuitive and responsive website is the difference between hitting goals and losing engagement. Top developers allow you to effectively improve your performance and scalability by building additional functionalities, integrating APIs, and increasing engagement on site.', 'mdi mdi-xml', NULL, 1, 0, 1, NULL, '2024-09-04 08:44:41', '2024-09-04 08:44:41'),
	(3, 'Customized Solutions', 'From requirements review to development, Toptal’s full-stack experts ensure your team will employ the latest technologies in Javascript frameworks (e.g. React.js, Ember.js, Node.js, Backbone.js), mean stack, and database technologies such as MySQL, NoSQL, PostgreSQL, and Mongo DB.', 'mdi mdi-desktop-mac', NULL, 1, 0, 1, NULL, '2024-09-04 08:44:41', '2024-09-04 08:44:41'),
	(4, 'Database & API Development', 'This term can be interpreted as an API (Application Programming Interface) that is used to interact with a database. Database APIs provide a set of functions, methods, or protocols that allow developers to access and manipulate data stored in a database.', 'mdi mdi-cellphone-iphone', NULL, 1, 0, 1, NULL, '2024-09-04 08:44:41', '2024-09-04 08:44:41');
